    return (
        <>
            <button className="square">{value}</button>
        </>
    )
}

export default function Board() {
    return (
        <>
            <div className="board">
                <Square value="1" />
                <Square />
                <Square />
                <Square />
                <Square />
                <Square />
                <Square />
                <Square />
                <Square />
            </div>
        </>
    )
}
